import React from 'react';

const Results = (searchResults) => {

    constdataDisplay = searchResults.map((info) => {
        return(
            <tr>
                <td>{info.label_id}</td>
                <td>{info.shipping_tracking_code}</td>
            </tr>
        )
    }
    )

    return (
        <div className="search-result">
            <table>
                <thead>
                <tr>
                    <th>Kit ID</th>
                    <th>Shipping Number</th>
                </tr>
                </thead>
                <tbody>
                    {dataDisplay}
                </tbody>

            </table>
        </div>
    );
}

export default Results;
